import React from 'react';
import Navigation from './Navigation';
import ImageGallery from 'react-image-gallery';

import './style.css';

var images = [];

for (var i = 0; i < 110; i++) {
    var page = './pages/' + i.toString() + '.jpg';
    var thumbnail = './thumbnails/' + i.toString() + '.jpg';

    images.push({ original: page, thumbnail: thumbnail});
}

